import {Component} from 'react';
import logo from './logo.svg';
import './App.css';

class App extends Component {

  constructor() {
    super();
    this.state = {
      linuxHosts : [
        {
          ip:'143.185.140.148'
        },
        {
          ip:'143.185.140.149'
        },
        {
          ip:'143.185.140.150'
        }

      ]
    }
  }

  render() {
    return (
      <div className="App">
        <h1>{this.state.ladh1507.ip}</h1>
        <h1>{this.state.ladh2588.ip}</h1>
        <h1>{this.state.ladh2599.ip}</h1>
      </div>
    );

  }
}

export default App;
